const weekdays = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'];
const getWeekdayIndex = (day) => weekdays.findIndex(weekDay => weekDay.includes(day));
const Weekday = (day) => day;

export default Weekday;
